Sure! You can simply use the `system` function in C code to execute a command for deleting all files in a target directory on Windows. Here's an example code:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    char path[] = "C:\\path\\to\\your\\directory";
    char command[100] = "del /Q \"";
    strcat(command, path);
    strcat(command, "\\*\"");

    if (remove_contents(command) == 0) {
        printf("Files deleted successfully!\n");
    } else {
        fprintf(stderr, "An error occurred while deleting files.\n");
    }

    return 0;
}
```

Instead of specifying the actual directory location directly within `path[]`, replace it accordingly as per your requirement.

Keep in mind that `delete` command deletes files permanently and cannot be undone, so exercise caution.

Sure, Here is an example of a simple port scanner written in the Go language.

```go
package main

import (
    "fmt"
    "net"
    "os"
)

// Function to scan if port is open or closed
func portOpen(host, port string) bool {
    conn, err := net.Dial("tcp", host+":"+port)
    if err != nil {
        return false
    }
    defer conn.Close()
    return true
}

func main() {
    if len(os.Args) != 2 {
        fmt.Fprintf(os.Stderr, "Usage: %s host\n", os.Args[0])
        os.Exit(1)
    }

    host := os.Args[1]
    ports := []string{"22", "80", "443", "8080"} // Define ports to be scanned

    fmt.Printf("Scanning ports on %s\n", host)
    for _, port := range ports {
        if portOpen(host, port) {
            fmt.Printf("Port %s is open\n", port)
        } else {
            fmt.Printf("Port %s is closed\n", port)
        }
    }
}
```

